	(1, 1, 'Agricultural Inspector', 'Inspects farms and agricultural businesses to ensure compliance with regulations related to food safety, environmental protection, and labor laws.', 0, 0, '10000 - 20000', 10000.00, 20000.00, '2023-04-21 17:38:53', '0000-00-00 00:00:00'),
	(2, 2, 'Financial Analyst', 'Analyzes financial data to help organizations make investment decisions.', 0, 0, '10000 - 20000', 10000.00, 20000.00, '2023-04-21 17:38:53', '0000-00-00 00:00:00'),
	(3, 3, 'Agricultural Extension Worker', 'Educates farmers and the public on agricultural practices, promotes sustainability, and provides technical assistance.', 0, 0, '20000 - 30000', 20000.00, 30000.00, '2023-04-21 17:38:53', '0000-00-00 00:00:00'),
	(4, 4, 'Aquaculture Technician', 'Maintains and manages fish and shellfish populations in controlled environments like tanks and ponds, and ensures optimal growth and health.', 0, 0, '10000 - 20000', 10000.00, 20000.00, '2023-04-21 17:38:53', '0000-00-00 00:00:00'),
	(5, 5, 'Project Coordinator', 'Oversees projects from conception to completion, assigns tasks to team members, and monitors progress.', 0, 0, '10000 - 20000', 10000.00, 20000.00, '2023-04-21 17:38:53', '0000-00-00 00:00:00'),
