INSERT INTO `tbl_jobs` (`job_id`, `employer_id`, `industry_id`, `job_title`, `job_description`, `job_type_id`, `job_sched_id`, `hire_needed`, `expected_hire_date`, `salary_details`, `salary_min`, `salary_max`, `courses`, `created_at`, `updated_at`) VALUES
	(1, 82, 12, 'Software Developer/Engineer', 'Design, develop, test, and maintain software applications.	', 1, 0, 6, NULL, '20000 - 30000', 20000.00, 30000.00, '27,28', '2023-04-21 18:38:48', '2023-04-21 18:39:48'),
	(2, 82, 12, 'Network Administrator', 'Manage and maintain computer networks, including hardware, software, and security protocols.', 3, 0, 8, NULL, '30000 - 40000', 30000.00, 40000.00, '27,28', '2023-04-21 18:42:39', '2023-04-21 20:54:37'),
	(3, 1, 8, 'Agronomist', 'Agronomists study plants and soil to help farmers improve their crop yields and efficiency. They research and develop new farming techniques, and provide guidance to farmers on topics like irrigation, fertilizer use, and pest management.', 1, 0, 9, NULL, '20000 - 30000', 20000.00, 30000.00, '1,2', '2023-04-21 18:49:34', '0000-00-00 00:00:00'),
	(4, 3, 6, 'Agricultural Economist', 'Agricultural economists analyze economic data and trends related to agriculture and food production. They develop economic models and conduct research to help farmers and agribusinesses make informed decisions about production, marketing, and sales.	', 1, 0, 7, NULL, '14000 - 20000', 14000.00, 20000.00, '1,2', '2023-04-21 23:25:20', '0000-00-00 00:00:00'),
	(5, 3, 6, 'Farm Manager', 'Farm managers oversee the daily operations of a farm or ranch, including crop and livestock production, equipment maintenance, and personnel management. They develop and implement strategies to optimize farm efficiency and profitability, and may also handle financial and administrative tasks.	', 1, 0, 8, NULL, '15000 - 20000', 15000.00, 20000.00, '1,2', '2023-04-21 23:27:14', '0000-00-00 00:00:00'),
	(6, 3, 6, 'Agronomist', 'Agronomists research and develop new methods for improving crop yields and soil health. They conduct field experiments, analyze data, and make recommendations for soil management, irrigation, and fertilization.	', 1, 0, 7, NULL, '20000 - 30000', 20000.00, 30000.00, '1,2', '2023-04-21 23:28:55', '0000-00-00 00:00:00'),
	(7, 83, 12, 'Web Developer', 'Design, develop, and maintain websites and web applications.	', 1, 0, 7, NULL, '30000 - 50000', 30000.00, 50000.00, '27,28', '2023-04-21 23:47:13', '0000-00-00 00:00:00'),
	(8, 83, 12, 'Database Administrator', 'Design, implement, and maintain databases, ensuring data accuracy, security, and availability.	', 1, 0, 59, NULL, '50000 - 60000', 50000.00, 60000.00, '27,28', '2023-04-21 23:50:56', '0000-00-00 00:00:00'),
	(9, 83, 12, 'Data Analyst	', 'Collect, process, and analyze data, providing insights and recommendations to inform business decisions.	', 1, 0, 6, NULL, '30000 - 50000', 30000.00, 50000.00, '27,28', '2023-04-21 23:52:59', '0000-00-00 00:00:00'),
	(10, 84, 12, 'Software Developer/Engineer', 'Design, develop, test, and maintain software applications.	', 1, 0, 8, NULL, '20000 - 30000', 20000.00, 30000.00, '27,28', '2023-04-21 23:58:01', '0000-00-00 00:00:00'),
	(11, 84, 12, 'Cybersecurity Analyst', 'Protect computer systems and networks from unauthorized access, attacks, and data breaches.', 1, 0, 5, NULL, '35000 - 40000', 35000.00, 40000.00, '27,28', '2023-04-22 00:00:52', '0000-00-00 00:00:00'),
	(12, 84, 12, 'Web Developer', 'Design, develop, and maintain websites and web applications.	', 1, 0, 7, NULL, '25000 - 30000', 25000.00, 30000.00, '27,28', '2023-04-22 00:02:59', '0000-00-00 00:00:00');
